, 
[75411007] = {id = 75411007, remark = "…今夜一晩かけて恩返しでも、\n私は構わないよ。", type = 1, option_ids = "0", next = 75411008, role_ids = "75200111", expression = "0", action = "0", action_type = "0", role_type = 75200111, position = "418:606:10050", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020004}
, 
[75411008] = {id = 75411008, remark = "なんてね、ふふ…", type = 1, option_ids = "75501101:75501102", next = 0, role_ids = "75200111", expression = "0", action = "0", action_type = "0", role_type = 75200111, position = "418:606:10050", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020004}
, 
[75411009] = {id = 75411009, remark = "おや、積極的だな。\nその期待には応えなくてはね。", type = 1, option_ids = "0", next = 75411011, role_ids = "75200111", expression = "0", action = "0", action_type = "0", role_type = 75200111, position = "418:606:10050", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020004}
, 
[75411010] = {id = 75411010, remark = "君は欲がないな。\nいくらでもワガママを言ってくれてもいいのに。", type = 1, option_ids = "0", next = 75411011, role_ids = "75200111", expression = "0", action = "0", action_type = "0", role_type = 75200111, position = "418:606:10050", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020004}
, 
[75411011] = {id = 75411011, remark = "しかし…君は本当に、私が何を言っても、\n何をしても許してくれるね。", type = 1, option_ids = "0", next = 75411012, role_ids = "75200111", expression = "0", action = "0", action_type = "0", role_type = 75200111, position = "418:606:10050", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020004}
, 
[75411012] = {id = 75411012, remark = "ふふ、メンバー達に好かれる理由がわかるよ。", type = 1, option_ids = "0", next = 75411013, role_ids = "75200111", expression = "0", action = "0", action_type = "0", role_type = 75200111, position = "418:606:10050", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020004}
, 
[75411013] = {id = 75411013, remark = "ああ、もちろん…私も君のことが好きだよ。\nとてもね。", type = 1, option_ids = "0", next = 75411014, role_ids = "75200111", expression = "0", action = "0", action_type = "0", role_type = 75200111, position = "418:606:10050", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020004}
, 
[75411014] = {id = 75411014, remark = "ただ、こうした真面目に好意を示す言葉さえも\n受け流されてしまうのは問題だ。", type = 1, option_ids = "0", next = 75411015, role_ids = "75200111", expression = "0", action = "0", action_type = "0", role_type = 75200111, position = "418:606:10050", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020004}
, 
[75411015] = {id = 75411015, remark = "いつかは…お姉さんの本気の好意に応えてくれると\n嬉しいよ、リーダー。", type = 1, option_ids = "0", next = -1, role_ids = "75200111", expression = "0", action = "0", action_type = "0", role_type = 75200111, position = "418:606:10050", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020004}
, 
[75411101] = {id = 75411101, remark = "――おや、リーダーじゃないか。", type = 1, option_ids = "0", next = 75411102, role_ids = "75200111", expression = "0", action = "0", action_type = "0", role_type = 75200111, position = "418:606:10050", role_admission_type = "75200111:50:0", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020001}
, 
[75411102] = {id = 75411102, remark = "お姉さんのことを覚えているかい？\nあのときはお嬢ともども世話になったね。", type = 1, option_ids = "0", next = 75411103, role_ids = "75200111", expression = "0", action = "0", action_type = "0", role_type = 75200111, position = "418:606:10050", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020001}
, 
[75411103] = {id = 75411103, remark = "今日はメイドらしく、\nお嬢のために買い出しに来てたところだよ。", type = 1, option_ids = "75501111:75501112", next = 0, role_ids = "75200111", expression = "0", action = "0", action_type = "0", role_type = 75200111, position = "418:606:10050", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020001}
, 
[75411104] = {id = 75411104, remark = "おや、優しいことを言ってくれるね。\nお姉さん感激で涙が出ちゃいそうだ。", type = 1, option_ids = "0", next = 75411106, role_ids = "75200111", expression = "0", action = "0", action_type = "0", role_type = 75200111, position = "418:606:10050", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020001}
, 
[75411105] = {id = 75411105, remark = "ああ、荷物は多いけど問題ないよ。\nありがとう、世話焼き好きさん。", type = 1, option_ids = "0", next = 75411106, role_ids = "75200111", expression = "0", action = "0", action_type = "0", role_type = 75200111, position = "418:606:10050", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020001}
, 
[75411106] = {id = 75411106, remark = "気を遣ってくれてありがたいけど、大丈夫だよ。\nこれでも鍛えているほうだからね。", type = 1, option_ids = "0", next = 75411107, role_ids = "75200111", expression = "0", action = "0", action_type = "0", role_type = 75200111, position = "418:606:10050", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020001}
, 
[75411107] = {id = 75411107, remark = "…しかし、そうだな。\nせっかくだし、喫茶店で一緒にお茶でもどうだい？", type = 1, option_ids = "0", next = 75411108, role_ids = "75200111", expression = "0", action = "0", action_type = "0", role_type = 75200111, position = "418:606:10050", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020001}
, 
[75411108] = {id = 75411108, remark = "ほら、この間のこと\n君に直接の礼をできていなかったしね。", type = 1, option_ids = "0", next = 75411109, role_ids = "75200111", expression = "0", action = "0", action_type = "0", role_type = 75200111, position = "418:606:10050", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020001}
, 
[75411109] = {id = 75411109, remark = "君とは一度ゆっくり話してみたかったし\nプライドにも興味があるしね。", type = 1, option_ids = "0", next = 75411110, role_ids = "75200111", expression = "0", action = "0", action_type = "0", role_type = 75200111, position = "418:606:10050", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020001}
, 
