[75411205] = {id = 75411205, remark = "リーダーも同じだろう？\nしかし、こんな夜更けにひとり歩きは危ないよ。", type = 1, option_ids = "0", next = 75411206, role_ids = "75200111", expression = "0", action = "0", action_type = "0", role_type = 75200111, position = "418:606:10050", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020004}
, 
[75411206] = {id = 75411206, remark = "万が一があったら大変だ。\nほら…おいで、お姉さんと一緒に帰ろう。", type = 1, option_ids = "0", next = 75411207, role_ids = "75200111", expression = "0", action = "0", action_type = "0", role_type = 75200111, position = "418:606:10050", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020004}
