, 
[75411208] = {id = 75411208, remark = "リーダーが望むならそれ以上も――\nふふ…なんてね。", type = 1, option_ids = "0", next = -1, role_ids = "75200111", expression = "0", action = "0", action_type = "0", role_type = 75200111, position = "418:606:10050", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020004}
, 
