[75411714] = {id = 75411714, remark = "目の前の幸せを大事にしている…\nしがないメイドさ。", type = 1, option_ids = "0", next = -1, role_ids = "75200111", expression = "0", action = "0", action_type = "0", role_type = 75200111, position = "418:606:10050", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020010}
, 
[75411801] = {id = 75411801, remark = "リストにあるものは全て買ったかな…よし。\nリーダー、買い物に付き合ってくれて助かったよ。", type = 1, option_ids = "0", next = 75411802, role_ids = "75200111", expression = "0", action = "0", action_type = "0", role_type = 75200111, position = "418:606:10050", role_admission_type = "75200111:50:0", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020001}
, 
[75411802] = {id = 75411802, remark = "休憩がてら、これから――", type = 1, option_ids = "0", next = 75411803, role_ids = "75200111", expression = "0", action = "0", action_type = "0", role_type = 75200111, position = "418:606:10050", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020001}
, 
[75411803] = {id = 75411803, remark = "サラ、探したぞ。\n――おまえの力が必要だ、今すぐ組織に戻ってこい。", type = 1, option_ids = "0", next = 75411804, role_ids = "75200111:75210059", expression = "0", action = "0", action_type = "0", role_type = 75210059, position = "195:606:10000,642:606:10050", role_admission_type = "75210059:-50:0", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020010}
, 
[75411804] = {id = 75411804, remark = "おや、久しいねお兄さん。\nでも…悪いけど、もう君と関わるつもりはないよ。", type = 1, option_ids = "0", next = 75411805, role_ids = "75200111:75210059", expression = "0", action = "0", action_type = "0", role_type = 75200111, position = "195:606:10050,642:606:10000", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020010}
, 
[75411805] = {id = 75411805, remark = "その仕事は、とっくに廃業したからね。", type = 1, option_ids = "0", next = 75411806, role_ids = "75200111:75210059", expression = "0", action = "0", action_type = "0", role_type = 75200111, position = "195:606:10050,642:606:10000", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020010}
, 
[75411806] = {id = 75411806, remark = "…勘違いするな、おまえに選択の余地はない。\n抵抗するならば、力尽くでも連れて帰るまでだ！", type = 1, option_ids = "0", next = -1, role_ids = "75200111:75210059", expression = "0", action = "0", action_type = "0", role_type = 75210059, position = "195:606:10000,642:606:10050", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020010}
, 
[75411807] = {id = 75411807, remark = "はぁ…相変わらず手荒いやつらだな。\nリーダー、驚かせてしまってすまない。", type = 1, option_ids = "0", next = 75411808, role_ids = "75200111", expression = "0", action = "0", action_type = "0", role_type = 75200111, position = "418:606:10050", role_admission_type = "75200111:50:0", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020007}
, 
[75411808] = {id = 75411808, remark = "これだけ巻き込んでしまったんだ、\n少し…昔のことを話さないといけないな。", type = 1, option_ids = "0", next = 75411809, role_ids = "75200111", expression = "0", action = "0", action_type = "0", role_type = 75200111, position = "418:606:10050", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020007}
, 
[75411809] = {id = 75411809, remark = "…物心ついたときから、\n人を傷つけるような…酷い仕事についていてね。", type = 1, option_ids = "0", next = 75411810, role_ids = "75200111", expression = "0", action = "0", action_type = "0", role_type = 75200111, position = "418:606:10050", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020007}
, 
[75411810] = {id = 75411810, remark = "その仕事で裏切られて、死にかけたときに、\n今の雇い主――お嬢の母親に助けてもらったのさ。", type = 1, option_ids = "0", next = 75411811, role_ids = "75200111", expression = "0", action = "0", action_type = "0", role_type = 75200111, position = "418:606:10050", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020007}
, 
[75411811] = {id = 75411811, remark = "今は遠方で治療をしているから、代わりに\nお嬢達の面倒を私が見てあげている、というわけさ。", type = 1, option_ids = "0", next = 75411812, role_ids = "75200111", expression = "0", action = "0", action_type = "0", role_type = 75200111, position = "418:606:10050", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020007}
, 
[75411812] = {id = 75411812, remark = "旦那様には嫌われているけれど\n私の出自は知っているから、手を出してこないよ。", type = 1, option_ids = "0", next = 75411813, role_ids = "75200111", expression = "0", action = "0", action_type = "0", role_type = 75200111, position = "418:606:10050", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020007}
, 
[75411813] = {id = 75411813, remark = "おっと…少し、話し過ぎたかな。", type = 1, option_ids = "0", next = 75411814, role_ids = "75200111", expression = "0", action = "0", action_type = "0", role_type = 75200111, position = "418:606:10050", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020007}
, 
[75411814] = {id = 75411814, remark = "でも、リーダーには、\n私のことを知ってほしいと思ったんだ。", type = 1, option_ids = "0", next = 75411815, role_ids = "75200111", expression = "0", action = "0", action_type = "0", role_type = 75200111, position = "418:606:10050", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020007}
, 
[75411815] = {id = 75411815, remark = "昔の私は…たしかに、ひどい人間だった。\nけれど…", type = 1, option_ids = "0", next = 75411816, role_ids = "75200111", expression = "0", action = "0", action_type = "0", role_type = 75200111, position = "418:606:10050", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020007}
, 
[75411816] = {id = 75411816, remark = "…今の私は、この平和な毎日を守りたいと、\n本気で思っているよ。信じてくれ。", type = 1, option_ids = "0", next = 75411817, role_ids = "75200111", expression = "0", action = "0", action_type = "0", role_type = 75200111, position = "418:606:10050", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020007}
, 
[75411817] = {id = 75411817, remark = "私は…リーダーと共にいたいよ。", type = 1, option_ids = "0", next = -1, role_ids = "75200111", expression = "0", action = "0", action_type = "0", role_type = 75200111, position = "418:606:10050", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020007}
, 
[75411901] = {id = 75411901, remark = "――おやぁ、リーダー。\n私が花に水をやっているのが不思議かい？", type = 1, option_ids = "0", next = 75411902, role_ids = "75200111", expression = "0", action = "0", action_type = "0", role_type = 75200111, position = "418:606:10050", role_admission_type = "75200111:50:0", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020001}
, 
[75411902] = {id = 75411902, remark = "ふふ、これでもメイドの端くれだからね。\n普通の仕事もたくさんするさ。", type = 1, option_ids = "0", next = 75411903, role_ids = "75200111", expression = "0", action = "0", action_type = "0", role_type = 75200111, position = "418:606:10050", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020001}
, 
[75411903] = {id = 75411903, remark = "この後もお嬢達の面倒を見て、掃除をして、\nアフタヌーンティーの準備をして…", type = 1, option_ids = "0", next = 75411904, role_ids = "75200111", expression = "0", action = "0", action_type = "0", role_type = 75200111, position = "418:606:10050", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020001}
, 
[75411904] = {id = 75411904, remark = "ああ、夜の予定も気にしてくれるかい？\nふふ、それは誘ってくれているのかな？", type = 1, option_ids = "0", next = 75411905, role_ids = "75200111", expression = "0", action = "0", action_type = "0", role_type = 75200111, position = "418:606:10050", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020001}
, 
[75411905] = {id = 75411905, remark = "夜はメイドも休憩タイムさ。\n予定はないから、いつでも誘ってくれるといいよ。", type = 1, option_ids = "0", next = 75411906, role_ids = "75200111", expression = "0", action = "0", action_type = "0", role_type = 75200111, position = "418:606:10050", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020001}
, 
[75411906] = {id = 75411906, remark = "案外普通だろう。でも、昔は手に入れられなかった…\n素晴らしい１日なんだ。", type = 1, option_ids = "0", next = 75411907, role_ids = "75200111", expression = "0", action = "0", action_type = "0", role_type = 75200111, position = "418:606:10050", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020001}
, 
[75411907] = {id = 75411907, remark = "リーダーの話も聞きたいところだけど、\n今言ったとおり予定があってね。", type = 1, option_ids = "0", next = 75411908, role_ids = "75200111", expression = "0", action = "0", action_type = "0", role_type = 75200111, position = "418:606:10050", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020001}
, 
[75411908] = {id = 75411908, remark = "今度、茶会でも開くから\nそのときお姉さんに話を聞かせてくれると嬉しいよ。", type = 1, option_ids = "75501191:75501192", next = 0, role_ids = "75200111", expression = "0", action = "0", action_type = "0", role_type = 75200111, position = "418:606:10050", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020001}
, 
[75411909] = {id = 75411909, remark = "楽しみにしていてくれ。\nもちろん、リーダーから誘ってくれていいけれど。", type = 1, option_ids = "0", next = 75411911, role_ids = "75200111", expression = "0", action = "0", action_type = "0", role_type = 75200111, position = "418:606:10050", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020001}
, 
[75411910] = {id = 75411910, remark = "リーダー、なかなかやる気だね。\nこれは根掘り葉掘り聞かないと。", type = 1, option_ids = "0", next = 75411911, role_ids = "75200111", expression = "0", action = "0", action_type = "0", role_type = 75200111, position = "418:606:10050", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020001}
, 
[75411911] = {id = 75411911, remark = "…本当に君は、どんなことでも\n受け入れてくれるんだな。", type = 1, option_ids = "0", next = 75411912, role_ids = "75200111", expression = "0", action = "0", action_type = "0", role_type = 75200111, position = "418:606:10050", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020001}
, 
[75411912] = {id = 75411912, remark = "今の１日も幸せだけれど、リーダーと過ごせれば\nきっともっと素晴らしい１日になるだろうね。", type = 1, option_ids = "0", next = 75411913, role_ids = "75200111", expression = "0", action = "0", action_type = "0", role_type = 75200111, position = "418:606:10050", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020001}
, 
[75411913] = {id = 75411913, remark = "お茶会、楽しみにしているよ。", type = 1, option_ids = "0", next = -1, role_ids = "75200111", expression = "0", action = "0", action_type = "0", role_type = 75200111, position = "418:606:10050", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020001}
, 
[75412001] = {id = 75412001, remark = "リーダー、今日は来てくれてありがとう。\nどうだ、一応片付いているだろう。", type = 1, option_ids = "0", next = 75412002, role_ids = "75200121", expression = "0", action = "0", action_type = "0", role_type = 75200121, position = "418:606:10050", role_admission_type = "75200121:50:0", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020004}
, 
[75412002] = {id = 75412002, remark = "それなりに、整理整頓を心がけるようになった。\nだがやはり、ひとりでは限界があってな…", type = 1, option_ids = "0", next = 75412003, role_ids = "75200121", expression = "0", action = "0", action_type = "0", role_type = 75200121, position = "418:606:10050", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020004}
, 
[75412003] = {id = 75412003, remark = "だから、向こうの棚の整理を手伝ってほしい。\n悪いが、よろしく頼む。", type = 1, option_ids = "0", next = -1, role_ids = "75200121", expression = "0", action = "0", action_type = "0", role_type = 75200121, position = "418:606:10050", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020004}
, 
[75412004] = {id = 75412004, remark = "助かった、リーダー。\n腹が減ったんじゃないか。何か食べるか。", type = 1, option_ids = "0", next = 75412005, role_ids = "75200121", expression = "0", action = "0", action_type = "0", role_type = 75200121, position = "418:606:10050", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020004}
, 
[75412005] = {id = 75412005, remark = "…私ひとりでは時間がかかる。\n料理も手伝ってほしい。", type = 1, option_ids = "0", next = -1, role_ids = "75200121", expression = "0", action = "0", action_type = "0", role_type = 75200121, position = "418:606:10050", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020004}
, 
[75412006] = {id = 75412006, remark = "美味そうにできたな。料理も掃除も、\nふたりでやるとこんなにはかどるのか。", type = 1, option_ids = "0", next = 75412007, role_ids = "75200121", expression = "0", action = "0", action_type = "0", role_type = 75200121, position = "418:606:10050", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020004}
, 
[75412007] = {id = 75412007, remark = "…いや、リーダーといるからはかどるのかもしれない。", type = 1, option_ids = "0", next = 75412008, role_ids = "75200121", expression = "0", action = "0", action_type = "0", role_type = 75200121, position = "418:606:10050", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020004}
, 
[75412008] = {id = 75412008, remark = "リーダーと一緒だと、家事も面倒じゃない…\nと感じる気がするんだ。", type = 1, option_ids = "0", next = 75412009, role_ids = "75200121", expression = "0", action = "0", action_type = "0", role_type = 75200121, position = "418:606:10050", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020004}
, 
[75412009] = {id = 75412009, remark = "これからもこうしてリーダーと一緒に\n家事をして暮らせたら、私は…", type = 1, option_ids = "0", next = 75412010, role_ids = "75200121", expression = "0", action = "0", action_type = "0", role_type = 75200121, position = "418:606:10050", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020004}
, 
[75412010] = {id = 75412010, remark = "…い、いや、なんでもない、気にするな。", type = 1, option_ids = "0", next = 75412011, role_ids = "75200121", expression = "0", action = "0", action_type = "0", role_type = 75200121, position = "418:606:10050", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020004}
, 
[75412011] = {id = 75412011, remark = "まったく、お前には私のいろんなところを\n見られてしまっている。", type = 1, option_ids = "0", next = 75412012, role_ids = "75200121", expression = "0", action = "0", action_type = "0", role_type = 75200121, position = "418:606:10050", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020004}
, 
[75412012] = {id = 75412012, remark = "家事をやらないこと、酒に弱いところ…\n本当に…誰にも言っていないことなんだぞ。", type = 1, option_ids = "0", next = 75412013, role_ids = "75200121", expression = "0", action = "0", action_type = "0", role_type = 75200121, position = "418:606:10050", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020004}
, 
[75412013] = {id = 75412013, remark = "ここまで私のことを知られてしまったとなると、\nお前にはしっかり責任を取ってもらわなければな。", type = 1, option_ids = "75501201:75501202", next = 0, role_ids = "75200121", expression = "0", action = "0", action_type = "0", role_type = 75200121, position = "418:606:10050", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020004}
, 
[75412014] = {id = 75412014, remark = "それはその…け、けっこ…\nんんっ！　なんでもない！", type = 1, option_ids = "0", next = 75412016, role_ids = "75200121", expression = "0", action = "0", action_type = "0", role_type = 75200121, position = "418:606:10050", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020004}
, 
[75412015] = {id = 75412015, remark = "そ、そんな気軽に言って…\nどうせ本気じゃないんだろう。", type = 1, option_ids = "0", next = 75412016, role_ids = "75200121", expression = "0", action = "0", action_type = "0", role_type = 75200121, position = "418:606:10050", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020004}
, 
